には、特殊文字のいずれかのプロシージャを割り当てるには (+、^、% というように)、文字を中かっこで囲みます。

このメソッドは、キー バッファーにキー入力を配置します。キーストロークを使用するメソッドを呼び出す前にいくつかの場合、このメソッドを呼び出す必要があります。たとえば、ダイアログ ボックスにパスワードを送信する必要があります SendKeysメソッドを呼び出すダイアログ ボックスを表示する前にします。
、の引数は、いずれか 1 つのキーまたは alt キーを押し、ctrl キーまたは shift キーを押し (またはこれらのキーの任意の組み合わせ) と組み合わせて、任意のキーを指定できます。各キーは、文字"a"など、1 つまたは複数の文字で表されます、"{}"の入力、ENTER キーまたは。(たとえば、ENTER キーまたは TAB)、対応するキーを押したときに表示されていない文字を使用して、次の表に示すコードを指定するのには
